import React, { useEffect } from 'react';

export default function Home() {
    useEffect(() => {
        const staff = JSON.parse(localStorage.getItem('staff'));
    });

    return (
        <>
            <h1 className="text-center">Equipo</h1>
            <div className="container">
                <div className="row"></div>
            </div>
        </>
    );
}

